```cpp
#include <iostream>
#include <string>

std::string markdownToHtml(const std::string& markdown) {
    std::string html = "<html><body>";

    // Convert Markdown to HTML
    for (size_t i = 0; i < markdown.size(); ++i) {
        if (markdown.substr(i, 2) == "##") {
            // Convert ## heading to <h2>
            if (i > 0 && markdown[i - 1] != '\\') {
                html += "<h2>";
                i += 2; // Skip the two characters "#"
                while (i < markdown.size() && markdown[i] != '\n') {
                    html += markdown[i];
                    ++i;
                }
                html += "</h2>";
            }
        } else if (markdown.substr(i, 3) == "###") {
            // Convert ### heading to <h3>
            if (i > 0 && markdown[i - 1] != '\\') {
                html += "<h3>";
                i += 3; // Skip the three characters "#"
                while (i < markdown.size() && markdown[i] != '\n') {
                    html += markdown[i];
                    ++i;
                }
                html += "</h3>";
            }
        } else if (markdown.substr(i, 2) == "# ") {
            // Convert # heading to <h1>
            if (i > 0 && markdown[i - 1] != '\\') {
                html += "<h1>";
                i += 2; // Skip the two characters "# "
                while (i < markdown.size() && markdown[i] != '\n') {
                    html += markdown[i];
                    ++i;
                }
                html += "</h1>";
            }
        } else if (markdown.substr(i, 3) == "### ") {
            // Convert ### heading to <h3>
            if (i > 0 && markdown[i - 1] != '\\') {
                html += "<h3>";
                i += 4; // Skip the four characters "### "
                while (i < markdown.size() && markdown[i] != '\n') {
                    html += markdown[i];
                    ++i;
                }
                html += "</h3>";
            }
        } else if (markdown[i] == '\n' && i > 0 && markdown[i - 1] != '\\') {
            // Convert new line to <br>
            html += "<br>";
        } else if (markdown.substr(i, 3) == "- ") {
            // Convert - item to <li> and start a <ul>
            if (i > 0 && markdown[i - 1] != '\\') {
                html += "<ul><li>";
                i += 3; // Skip the three characters "- "
                while (i < markdown.size() && markdown[i] != '\n') {
                    html += markdown[i];
                    ++i;
                }
                html += "</li></ul>";
            }
        } else if (markdown.substr(i, 1) == "*") {
            // Convert * item to <li> in <ul>
            if (i > 0 && markdown[i - 1] != '\\') {
                html += "<li>";
                while (i < markdown.size() && markdown[i] != '\n') {
                    html += markdown[i];
                    ++i;
                }
                html += "</li>";
            }
        } else if (markdown.substr(i, 2) == "-\n" || markdown.substr(i, 2) == "*\n") {
            // Close the last <li> if it exists
            if (!html.empty() && html.back() != '<') {
                html.pop_back(); // Remove the last >
                if (html.back() == '<') {
                    html.pop_back(); // Remove the last <
                }
                html += "</ul>";
            }
        } else {
            // Directly copy the character to HTML
            html += markdown[i];
        }
    }

    html += "</body></html>";

    return html;
}

int main() {
    std::string markdown = "## Heading\n\n- Item 1\n- Item 2\n\n### Sub-heading\n- Another item";
    std::string html = markdownToHtml(markdown);
    std::cout << html << std::endl;

    return 0;
}
```

This code defines a function `markdownToHtml` that converts simple Markdown formatting into HTML. It handles headers, bullet points, and line breaks. Note that this is a simplified version and does not cover all Markdown syntax. For more complex Markdown to HTML conversion, you might want to use a dedicated library like `commonmark`.

