Here's a Java solution that does not use loops or recursion:

```java
public boolean isPowerOfThree(int n) {
    // Check if n is positive
    if (n <= 0) {
        return false;
    }

    // Find the maximum power of 3 within the range of int
    long maxPowerOfThree = 1;
    while (maxPowerOfThree * 3 <= Integer.MAX_VALUE) {
        maxPowerOfThree *= 3;
    }

    // Check if n is a factor of this maximum power of 3
    return maxPowerOfThree % n == 0;
}
```

