```

However, the above code snippet might not work perfectly due to precision issues with `BigDecimal`. Instead, we can use a different approach by finding the maximum power of three that fits within the `int` range and checking if `n` divides this value exactly.

Here is a more robust solution:

```java
public boolean isPowerOfThree(int n) {
    // Check if n is positive
    if (n <= 0) {
        return false;
    }

    // Maximum power of 3 that fits within the int range
    int maxPowerOfThree = 1162261467; // 3^19, which is the largest power of 3 within int range

