```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <algorithm> // For std::tolower

int main() {
    std::string filename;
    std::cout << "Enter the name of the text file: ";
    std::cin >> filename;

    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Failed to open the file: " << filename << std::endl;
        return 1;
    }

    std::string searchWord;
    std::cout << "Enter the word to search for: ";
    std::cin >> searchWord;

    int count = 0;
    std::string line;

    // Read the file line by line
    while (std::getline(file, line)) {
        // Convert the line to lowercase for case-insensitive comparison
        std::transform(line.begin(), line.end(), line.begin(), ::tolower);

        // Split the line into words and count occurrences of the search word
        size_t pos = 0;
        while ((pos = line.find(searchWord, pos)) != std::string::npos) {
            count++;
            pos += searchWord.length();
        }
    }

    file.close();

    std::cout << "The word '" << searchWord << "' occurs " << count << " times in the file." << std::endl;

    return 0;
}
```

### Explanation:
1. **File Handling**:
   - The program first asks the user to input the name of the text file.
   - It then opens the file using an `ifstream` object.
   - If the file cannot be opened, it prints an error message and exits with a non-zero status.

2. **Search Word Input**:
   - The user is prompted to enter the word they want to search for.

3. **Reading the File Line by Line**:
   - The program uses a `while` loop to read each line of the file using `std::getline`.
   - Each line is converted to lowercase using `std::transform` to ensure case-insensitive comparison.

4. **Counting Occurrences**:
   - The program searches for the specified word within each line using `std::find`.
   - If the word is found, it increments the count and continues searching from the position after the found word.

5. **Output**:
   - Finally, the program outputs the total number of occurrences of the specified word in the file.

### Notes:
- This program assumes that words are separated by spaces. If your file has different delimiters or you need more advanced word separation, you may need to modify the logic accordingly.
- The program is case-insensitive, meaning it will count both "Word" and "word".

